import React, { useState } from 'react';
import { Route } from 'react-router-dom';
import { Account } from './';

const App = () => {
    const [token, setToken] = useState('');
    const [userData, setUserData]= useState({})
    console.log(`Token is: ${token}`);
    return (
        <>
         <h1>Stranger's Thing:</h1>
         <h2>Where Stranger is Better!</h2>
        <Route exact path='/'>
            Welcome Back, {userData.username}!</Route>
        <Route path= '/login'>
        <Account action= 'login' setToken={setToken} setUserData= {setUserData}/>
        </Route>
        <Route path ='/register'>
        <Account action= 'register' setToken={setToken} setUserData= {setUserData} />
        </Route>
        </>
    );
};

export default App;
